  root: {
    flexGrow: 1
  }
}));





export default function Users() {
  const classes = useStyles();

  return (
    <div className={classes.root}>

        <Grid container spacing={10}>


        <Grid item xs={12} sm={0} >

          </Grid>

          <Grid item xs={12} sm={6} >
              <Singup/>
          </Grid>

          <Grid item xs={12} sm={6}>
              <Login/>
          </Grid>


        </Grid>
    </div>
  );
}
